B.a55=new A.G1("### * \ub538\uae30\uc601\uc5b4\ub294 \uc2a4\ud53c\ud0b9 \ub2a5\ub825 \ud5a5\uc0c1\uc5d0 \uc9d1\uc911\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\ud574\ub2f9 \ud1a0\ud53d\uc740 \ub808\ubca8\uc5d0 \ub530\ub77c \ub098\ub220\uc9c4 \uac83\uc774 \uc544\ub2c8\ub77c  \n\ud559\uc0dd\ubd84\ub4e4\uc758 \uacf5\ubd80 \ubaa9\uc801\uc5d0 \ub530\ub77c \ud1a0\ud53d\uc744 \uc120\ud0dd\ud558\uc2dc\uba74 \ub808\ubca8\uc5d0 \ub9de\ucdb0 \uc218\uc5c5\uc774 \uc9c4\ud589\ub418\uaca0\uc2b5\ub2c8\ub2e4.  \n\u205f\n# \u205f\n# \u205f\n# \u205f\n# \u205f\n## 1\ufe0f\u20e3 **\uc2a4\ud53c\ud0b9 \uc2a4\ud0ac**  \n\u205f   \n\u205f\u205f\u205f**Structured Speaking**  \n    \n- Grammar, Pronunciations, Expressions, Idioms  \n- \ubb38\uc7a5 \uad6c\uc870\ub97c \ub9cc\ub4dc\ub294 \uac83\uc774 \uc5b4\ub835\uace0 \uae30\ucd08\ub97c \uc7a1\uae30 \uc6d0\ud558\ub294 \ucd08\ubcf4\uc790 \ud639\uc740 \uc880 \ub354 \ub17c\ub9ac\uc801\uc774\uace0 \uc804\ubb38\uc801\uc778 \uc2a4\ud53c\ud0b9\uc744 \uc6d0\ud558\ub294 \uc911, \uace0\uae09 \ud559\uc0dd\uc5d0\uac8c \ucd94\ucc9c!  \n   \n\u205f   \n\u205f\u205f\u205f**Business English**  \n- Office Expressions, Business Expressions, Business meetings and presentations, etc.  \n- \ube44\uc988\ub2c8\uc2a4 \ubbf8\ud305 \uc608\uc808, \ud504\ub808\uc820\ud14c\uc774\uc158 \uac19\uc740 \uc5c5\ubb34\uc801\uc778 \uc6a9\uc5b4\ub97c \ubc30\uc6b0\uace0 \ucee4\ub9ac\uc5b4 \ud558\uc774\ub97c \ucc0d\uace0 \uc2f6\uc740 \ube44\uc988\ub2c8\uc2a4 \ub9e8 & \uc6cc\uba3c\uc5d0\uac8c \ucd94\ucc9c!  \n\n\u205f   \n\u205f\u205f\u205f**Power/Fluency**  \n- Free Conversational class  \n- \ubd80\ub2f4 \uc5c6\uc774 \uae30\ucd08\uc801\uc778 \uc77c\uc0c1 \ub300\ud654\ub97c \uc6d0\ud654\ub294 \ucd08\ubcf4\uc790 \ud639\uc740 \uc2a4\ud53c\ud0b9 \ub2a5\ub825 \uc720\uc9c0\uc640 \ubcf8\uc778\uc758 \uc0dd\uac01\uc744 \uc790\uc720\ub86d\uac8c \uc774\uc57c\uae30\ud558\ub294 \ud1a0\ub860\uc2dd \uc218\uc5c5\uc744 \uc6d0\ud558\ub294 \uc911, \uace0\uae09 \ud559\uc0dd\uc5d0\uac8c \ucd94\ucc9c  \n\n\u205f\n# \u205f\n# \u205f\n# \u205f\n# \u205f\n## 2\ufe0f\u20e3 **\uc8fc\ub2c8\uc5b4 \uc2a4\ud53c\ud0b9**  \n\u205f   \n\u205f\u205f\u205f**Kids English**  \n    \n- Reading, Speaking, and Comprehension  \n- 3~15\uc138 \uae30\ucd08 \uc8fc\ub2c8\uc5b4 \ud559\uc0dd\uc5d0\uac8c \ucd94\ucc9c!  \n\n\u205f  \n# \u205f\n# \u205f\n# \u205f\n# \u205f\n## 3\ufe0f\u20e3 **\uc5b4\ud559\uc2dc\ud5d8**  \n\u205f  \n- IELTS Speaking  \n- TOEIC Speaking  \n- OPIC  \n",null)
B.a56=new A.G1("### \ub4f1\ub85d\uaddc\uc815\uc744 \uc815\ub3c5\ud574\uc8fc\uc138\uc694!  \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 1\ufe0f\u20e3 **\uc77c\uc2dc\uc801\uc73c\ub85c \uc2dc\uac04 \ubcc0\ub3d9\uc774 \uc788\uc744 \uc2dc**  \n\u205f  \n\uc2a4\ucf00\uc904 \ubcc0\uacbd\uc73c\ub85c \uc778\ud574 \uc784\uc2dc\ub85c \uc2dc\uac04\uc744 \uc870\uc815\ud574\uc57c \ud560 \uacbd\uc6b0, \uc218\uc5c5 \uc2dc\uc791 12\uc2dc\uac04 \uc804\uae4c\uc9c0 \ub2f4\ub2f9 \ud29c\ud130\uc5d0\uac8c \uc9c1\uc811 \uc5f0\ub77d \ud639\uc740 \ub538\uae30\uc601\uc5b4 \uce74\ud1a1 \ucc44\ub110\uc744 \ud1b5\ud574 \uc5f0\ub77d \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.  \n\u205f  \n+\uc218\uc5c5 \ub2f9\uc77c\uc5d0 \ubcc0\uacbd \uc694\uccad\uc774\ub098 \uc0ac\uc804 \uacf5\uc9c0 \uc5c6\uc774 \ubd88\ucc38\ud560 \uacbd\uc6b0, \ub300\uccb4 \uc218\uc5c5\uc740 \uc81c\uacf5\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.  \n\u205f  \n+12\uc6d4 25\uc77c\uacfc 1\uc6d4 1\uc77c\uc740 \ud734\uac15\uc774\uba70 \ud574\ub2f9 \uc218\uc5c5\uc740 \uc790\ub3d9\uc73c\ub85c \uc5f0\uae30\ub429\ub2c8\ub2e4.  \n\u205f  \n+\uadf8 \uc678\uc758 \ud55c\uad6d \ubc0f \ud544\ub9ac\ud540 \uacf5\ud734\uc77c\uc5d0\ub294 \uc815\uc0c1 \uc218\uc5c5\uc774 \uc9c4\ud589\ub429\ub2c8\ub2e4.  \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 2\ufe0f\u20e3**\uace0\uc815 \uc2dc\uac04 \ubcc0\uacbd\uc744 \uc6d0\ud55c\ub2e4\uba74**  \n\u205f  \n\uace0\uc815 \uc2dc\uac04 \ubcc0\uacbd\uc744 \uc6d0\ud558\uc2e4 \uacbd\uc6b0, \ub538\uae30\uc601\uc5b4 \uce74\ud1a1 \ucc44\ub110\uc744 \ud1b5\ud574 \uc5f0\ub77d \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4. \uc6d0\ud65c\ud55c \uc218\uc5c5 \uc9c4\ud589\uc744 \uc704\ud574 \uc218\uc5c5 12\uc2dc\uac04 \uc774\uc804\uae4c\uc9c0 \uc5f0\ub77d \ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 3\ufe0f\u20e3 **\uc218\uc5c5 \ucde8\uc18c \ubc0f \uc218\uc5c5 \uc815\uc9c0\uac00 \ud544\uc694\ud55c \uacbd\uc6b0**  \n\u205f  \n**\uc218\uc5c5 \ucde8\uc18c\ub294 \ucd5c\uc18c \uc218\uc5c5 \uc2dc\uc791 12\uc2dc\uac04 \uc804\uc5d0 \ub9c8\uc774\ud398\uc774\uc9c0\ub97c \ud1b5\ud574 \uc694\uccad\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.**  \n\u205f  \n\u2705\ub9c8\uc774\ud398\uc774\uc9c0: https://yj7-park.github.io/web/  \n\u205f  \n**\uc7a5\uae30 \uc911\ub2e8 \uc694\uccad\uc740 \ub9c8\uc774\ud398\uc774\uc9c0\uac00 \uc544\ub2cc \ub538\uae30\uc601\uc5b4 \uce74\ud1a1 \ucc44\ub110\uc744 \ud1b5\ud574 \uc5f0\ub77d\uc8fc\uc154\uc57c \ud558\uba70,  12\uc2dc\uac04 \uc774\ub0b4\uc5d0 \uc694\uccad\ud558\uc2e4 \uacbd\uc6b0 \uc218\uc5c5\uc774 1\ud68c \ucc28\uac10\ub429\ub2c8\ub2e4.**  \n\u205f  \n\uc5ec\ud589\uc774\ub098 \uc5c5\ubb34\ub85c \uc778\ud574 \uc7a5\uae30 \uc218\uc5c5 \uc815\uc9c0\uac00 \ud544\uc694 \ud560 \uc2dc, \uae30\uc874 \ud29c\ud130\ub294 \ubcf4\uc7a5\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uc218\uc5c5\uc744 \ub2e4\uc2dc \uc2dc\uc791\ud558\uace0\uc790 \ud560 \uacbd\uc6b0, \uce74\ud1a1\ucc44\ub110\uc744 \ud1b5\ud574 \uc7ac\uac1c \uc694\uccad\uc744 \uc8fc\uc2dc\uba74 \uc218\uc5c5 \ud655\uc815 \ud6c4 \uc548\ub0b4 \ub4dc\ub9ac\uaca0\uc2b5\ub2c8\ub2e4.  \n\u205f  \n\uc7a5\uae30\uac04 \uc218\uc5c5 \uc815\uc9c0\ub97c \uc6d0\ud558\uc2dc\ub294 \uacbd\uc6b0 \ucd5c\ub300 1\ub144 \uae4c\uc9c0 \uac00\ub2a5\ud558\uba70, 1\ub144\uc774 \uc9c0\ub09c \uc774\ud6c4 \uc7ac\uac1c\ub418\uc9c0 \uc54a\uc744 \uacbd\uc6b0 \ud574\ub2f9 \uc218\uc5c5\uc740 \uc18c\uba78\ub429\ub2c8\ub2e4.  \n(\uc218\uc5c5 \uc911\ub2e8 \ucd1d \ud569 \ucd5c\ub300 365\uc77c \uae4c\uc9c0 \uac00\ub2a5-\uc8fc\ub9d0 \ud3ec\ud568)  \n\u205f  \n\ucde8\uc18c \ud69f\uc218 \ubc0f \uc218\uc5c5 \uc911\uc9c0 \uac00\ub2a5 \ud69f\uc218\ub294 \uad6c\ub3c5 \uae30\uac04\uacfc \uc8fc \uc218\uc5c5 \ud69f\uc218\uc5d0 \ub530\ub77c \uc544\ub798\uc640 \uac19\uc2b5\ub2c8\ub2e4.  \n\u205f  \n**>>1\uac1c\uc6d4 \uad6c\ub3c5<<**  \n\uc8fc 2\ud68c \uc218\uc5c5: 2\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0  \n\uc8fc 3\ud68c \uc218\uc5c5: 3\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0  \n\uc8fc 5\ud68c \uc218\uc5c5: 5\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0  \n\u205f  \n**>>3\uac1c\uc6d4 \uad6c\ub3c5<<**  \n\uc8fc 2\ud68c \uc218\uc5c5: 5\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0  \n\uc8fc 3\ud68c \uc218\uc5c5: 7\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0  \n\uc8fc 5\ud68c \uc218\uc5c5: 12\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 4\ufe0f\u20e3 **\uc218\uc5c5\uc2dc\uac04\uc5d0 \uc9c0\uac01\ud560 \uacbd\uc6b0**  \n\u205f  \n\uc218\uc5c5 \uc2dc\uac04\uc5d0 \uc9c0\uac01\ud560 \uacbd\uc6b0 \ud29c\ud130\ub294 10\ubd84\uac04 \uae30\ub2e4\ub9bd\ub2c8\ub2e4. 10\ubd84 \uc774\ud6c4 \ubd88\ucc38 \uc2dc \ud574\ub2f9 \uc218\uc5c5\uc740 \uc790\ub3d9 \ucde8\uc18c\ub418\uba70 \ub300\uccb4 \uc218\uc5c5\uc740 \uc81c\uacf5\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 5\ufe0f\u20e3 **\ud29c\ud130 \uc0ac\uc720\ub85c \uc218\uc5c5\uc744 \uc9c4\ud589\ud558\uc9c0 \ubabb\ud560 \uc2dc**  \n\u205f  \n- \ucd5c\uc800 \uc218\uc5c5\ub8cc\ub97c \uc720\uc9c0\ud558\uae30 \uc704\ud574 \ud29c\ud130\ub294 \uc624\ud53c\uc2a4\uac00 \uc544\ub2cc \uc790\ud0dd\uc5d0\uc11c \uadfc\ubb34\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub85c \uc778\ud574 \ud29c\ud130\uc758 \uc0ac\uc720\ub85c \uc778\ud55c \uc218\uc5c5 \ub204\ub77d\uc774 \ub4dc\ubb3c\uac8c \ubc1c\uc0dd \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. 5\ubd84\uc774 \uc9c0\ub098\ub3c4 \ud29c\ud130\uac00 \ub098\ud0c0\ub098\uc9c0 \uc54a\uc73c\uba74 \ub538\uae30\uc601\uc5b4 \ucc44\ub110\uc744 \ud1b5\ud574 \uc5f0\ub77d\uc744 \ub0a8\uaca8\uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.  \n- \ud29c\ud130 \uc5ed\uc2dc 12\uc2dc\uac04 \uc218\uc5c5 \uc5f0\uae30 \uaddc\uce59\uc774 \uc801\uc6a9 \ub429\ub2c8\ub2e4. \ud29c\ud130\uac00 \uc218\uc5c5 \uc2dc\uc791 12\uc2dc\uac04 \uc774\uc804\uc5d0 \uc218\uc5c5\uc744 \uc5f0\uae30\ud558\ub294 \uacbd\uc6b0, \uc2a4\uce74\uc774\ud504\ub85c \uc5f0\ub77d\uc744 \ub4dc\ub9ac\uac70\ub098 \uc6b4\uc601\uc9c4\uc5d0\uc11c \uce74\ud1a1\uc73c\ub85c \uc548\ub0b4\ub97c \ub4dc\ub9ac\uba70 \ud574\ub2f9 \uc218\uc5c5\uc740 \ubcf4\ucda9 \uc218\uc5c5\uc73c\ub85c \uc81c\uacf5\ub429\ub2c8\ub2e4.  \n- \ud29c\ud130\uac00 \uc218\uc5c5 \uc2dc\uc791 12\uc2dc\uac04 \uc774\ub0b4\uc5d0 \uc218\uc5c5\uc744 \uc5f0\uae30\ud558\uac70\ub098 \ube60\uc9c0\ub294 \uacbd\uc6b0 \uc9c4\ud589\ub418\uc9c0 \uc54a\uc740 \uc218\uc5c5\uc740 \uc5f0\uae30\ud558\uace0, \ubcf4\uc0c1\uc73c\ub85c 1,000 \ud3ec\uc778\ud2b8 \ucfe0\ud3f0\uc744 \uc9c0\uae09\ud574 \ub4dc\ub9bd\ub2c8\ub2e4.  \n- \ub9cc\uc57d, \ud29c\ud130\uc758 \uc0ac\uc804 \uacf5\uc9c0 \uc5c6\uc774 \uc218\uc5c5\uc5d0 \ubd88\ucc38\ud560 \uacbd\uc6b0, \uc9c4\ud589\ub418\uc9c0 \uc54a\uc740 \uc218\uc5c5\uc740 \uc5f0\uae30\ud558\uace0, \ubcf4\uc0c1\uc73c\ub85c 3,000 \ud3ec\uc778\ud2b8 \ucfe0\ud3f0\uc744 \uc9c0\uae09\ud574 \ub4dc\ub9bd\ub2c8\ub2e4. \ud3ec\uc778\ud2b8\ub294 \ub2e4\uc74c \uc218\uc5c5 \uacb0\uc81c\uc2dc \ud604\uae08\uacfc \ub3d9\uc77c\ud558\uac8c \uc0ac\uc6a9\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.  \n- \uc790\uc5f0\uc7ac\ud574(\ud0dc\ud48d, \uc9c0\uc9c4, \ud654\uc7ac \ub4f1) \ud639\uc740 \uc0ac\uace0 \ubc0f \uc9c8\ubcd1\uc73c\ub85c \uc778\ud574 \uac11\uc791\uc2a4\ub7fd\uac8c \uc218\uc5c5\uc774 \ucde8\uc18c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc790\uc5f0\uc7ac\ud574\ub85c \uc778\ud55c \uc218\uc5c5 \ucde8\uc18c\uc758 \uacbd\uc6b0, \ud574\ub2f9 \uc218\uc5c5\uc740 \uc790\ub3d9\uc73c\ub85c \uc5f0\uae30\ub418\uba70 \ud3ec\uc778\ud2b8\ub294 \uc9c0\uae09\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 6\ufe0f\u20e3 **\uacb0\uc81c \ubc29\uc2dd**  \n\u205f  \n\uacc4\uc88c\uc774\uccb4\ub9cc \uac00\ub2a5\ud558\uba70, \uce74\ub4dc\uacb0\uc81c\ub294 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4. \ud604\uae08\uc601\uc218\uc99d \ubc1c\ud589\uc774 \ud544\uc694\ud55c \uacbd\uc6b0 \ud734\ub300\ud3f0 \ubc88\ud638 \ub610\ub294 \uac1c\uc778 \ud604\uae08\uc601\uc218\uc99d \ubc88\ud638\ub97c \ub9d0\uc500\ud574\uc8fc\uc138\uc694.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 7\ufe0f\u20e3 **\uc7ac\ub4f1\ub85d \ubc29\ubc95**  \n\u205f  \n\uc601\uc5c5\uc77c 3\uc77c \uc804\uc5d0 \uc218\uc5c5 \uc885\ub8cc\uc77c\uc744 \uc548\ub0b4\ub4dc\ub9bd\ub2c8\ub2e4. \uc885\ub8cc\uc77c \uc790\uc815 12\uc2dc\uae4c\uc9c0 \uc785\uae08 \ud6c4, \uce74\uce74\uc624\ud1a1 \ucc44\ub110\ub85c \u2018\uc785\uae08 \uc644\ub8cc\u2019 \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0b4\uc8fc\uc2dc\uba74 \uc790\ub3d9\uc73c\ub85c \uc5f0\uc7a5 \ub429\ub2c8\ub2e4. \uc5f0\uc7a5\ud558\uc9c0 \uc54a\uc744 \uacbd\uc6b0, \uce74\uce74\uc624\ud1a1 \ucc44\ub110\ub85c \uc5f0\ub77d\uc8fc\uc2dc\uac70\ub098 \uc218\uc5c5 \uc885\ub8cc\uc77c \uc790\uc815 12\uc2dc\uae4c\uc9c0 \uc785\uae08\uc774 \uc9c4\ud589\ub418\uc9c0 \uc54a\uc740 \uacbd\uc6b0 \uc218\uc5c5\uc774 \uc885\ub8cc\ub429\ub2c8\ub2e4.  \n\u205f  \n\ub9cc\uc57d, 12\uc2dc \uc774\ud6c4\uc5d0 \uc785\uae08\ub420 \uacbd\uc6b0 \ub2f4\ub2f9\ud29c\ud130\uac00 \ubcc0\uacbd \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 8\ufe0f\u20e3 **\ud658\ubd88 \uaddc\uc815**  \n\u205f  \n\uc218\uc5c5 \uc2dc\uc791 1\uc8fc\uc77c \uc774\ub0b4 \ud658\ubd88 \uc694\uccad\uc2dc 1\uc8fc\uc77c \uc218\uc5c5\ube44\ub97c \uc81c\uc678\ud55c \ub098\uba38\uc9c0 \uae08\uc561\uc744 \ud658\ubd88\ud574\ub4dc\ub9bd\ub2c8\ub2e4. 1\uc8fc\uc77c \uc774\ud6c4\ubd80\ud130\ub294 \ud658\ubd88 \ubd88\uac00\ud558\ub2c8 \uc720\uc758\ud574\uc8fc\uc138\uc694.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## 9\ufe0f\u20e3 **\uae30\ud0c0 \uc218\uc5c5 \uaddc\uc815 \ubc0f \uc81c\uacf5 \ud504\ub85c\uadf8\ub7a8**\n\u205f  \n- **\uc815\uaddc\uc218\uc5c5\uad6c\uc131**  \n\ub538\uae30\uc601\uc5b4\ub294 \ud68c\ub2f9 \ucd1d 30\ubd84 \uc218\uc5c5\uc73c\ub85c 25\ubd84 \uc218\uc5c5\uacfc 5\ubd84 \ud53c\ub4dc\ubc31\uc73c\ub85c \uad6c\uc131\ub418\uc5b4\uc788\uc2b5\ub2c8\ub2e4. \ud53c\ub4dc\ubc31 \uc2dc\uac04\uc740 \ud53c\ub4dc\ubc31 \ub0b4\uc6a9\uc774 \uc801\uac70\ub098 \ub2e4\uc74c \uc218\uc5c5\uc744 \uc704\ud574 \uc870\uae08 \uc77c\ucc0d \ub9c8\ubb34\ub9ac\ub420 \uc218 \uc788\ub2e4\ub294 \uc810\uc744 \uc591\ud574 \ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4.  \n\u205f  \n- **\uc218\uc5c5\ub179\ud654\uc5d0 \uad00\ud558\uc5ec**  \n\ub538\uae30\uc601\uc5b4\uc758 \ubaa8\ub4e0 \uc218\uc5c5\uc740 \ub179\ud654\ub418\uc5b4 \ud574\ub2f9 \uc218\uc5c5 \uc774\ud6c4\uc5d0\ub294 \uc2a4\uce74\uc774\ud504 \ucc44\ub110\ub85c \ubc1c\uc1a1\ub429\ub2c8\ub2e4. \ub179\ud654\ub41c \uc790\ub8cc\ub294 \ud559\uc0dd\uacfc \ud29c\ud130\ub97c \ubcf4\ud638\ud558\uae30 \uc704\ud574 \uc548\uc804\ud558\uac8c \ubcf4\uad00\ub418\uba70, \ub2f9\uc0ac\uc790\uc758 \ub3d9\uc758\uc5c6\uc774 \uc5b4\ub5a0\ud55c \uc6a9\ub3c4\ub85c\ub3c4 \uc0ac\uc6a9\ub418\uc9c0 \uc54a\uc74c\uc744 \uc54c\ub824\ub4dc\ub9bd\ub2c8\ub2e4.  \n\u205f  \n- **\uc2a4\uce74\uc774\ud504 \ubb38\uc81c**  \n\ub9cc\uc57d \uc2a4\uce74\uc774\ud504 \ud504\ub85c\uadf8\ub7a8\uc758 \ubb38\uc81c\ub85c \uc218\uc5c5\uc774 \uc9c4\ud589\ub418\uc9c0 \uc54a\uc744 \uacbd\uc6b0, \ud68c\uc6d0\ub2d8\uacfc \ud29c\ud130 \ubaa8\ub450\uc5d0\uac8c \ud328\ub110\ud2f0 \uc5c6\uc774 \ud574\ub2f9 \uc218\uc5c5\uc740 \uc5f0\uae30 \ucc98\ub9ac\ub429\ub2c8\ub2e4. \uc2a4\uce74\uc774\ud504 \ubb38\uc81c\ub294 https://downdetector.com/status/skype/ \ud398\uc774\uc9c0\uc5d0\uc11c \ub3d9\uc2dc\uc5d0 100\ud68c \uc774\uc0c1\uc758 \uc2e0\uace0\uac00 \uc788\uc744 \uacbd\uc6b0\uc5d0\ub9cc \ud574\ub2f9\ub429\ub2c8\ub2e4.   \n\u205f  \n- **\ucfe0\ud3f0**  \n\ucfe0\ud3f0\uc740 \ubc1c\uae09 \uc2dc\uc810\ubd80\ud130 1\ub144 \ub3d9\uc548 \uc0ac\uc6a9 \uac00\ub2a5\ud558\uba70, \ud3ec\uc778\ud2b8\ub97c \ud604\uae08\uc73c\ub85c \uc804\ud658\ud558\ub294 \uac83\uc740 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.   \n# \u205f  \n# \u205f  \n# \u205f  \n\u205f  \n## \ud83d\udc9c **\ub2f9\ubd80\uc758 \ub9d0\uc500** \ud83d\udc9c  \n\u205f  \n**\u201cBetter Life for Tutors and Students\u201d**  \n\u205f  \n\ub538\uae30\uc601\uc5b4\ub294 \u2018\ud559\uc0dd\uc5d0\uac8c\ub294 \ud569\ub9ac\uc801\uc778 \uac00\uaca9\uc744, \ud29c\ud130\uc5d0\uac8c\ub294 \ud569\ub9ac\uc801\uc778 \ubcf4\uc0c1\uc73c\ub85c\u2019 \uc9c0\uc18d \uac00\ub2a5\ud55c \uc601\uc5b4\ud68c\ud654 \uc11c\ube44\uc2a4 \uc0dd\ud0dc\uacc4\ub97c \uad6c\ucd95\ud558\uace0\uc790 \ub178\ub825\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.   \n\u205f  \n\ud29c\ud130\ubd84\ub4e4\uc740 \uc601\uc5b4\ub97c \uac00\ub974\uce58\ub294 \uc120\uc0dd\ub2d8\uc774\uae30 \uc804\uc5d0 \ud55c \uc0ac\ub78c\uc784\uc744 \uae30\uc5b5\ud574\uc8fc\uc2dc\uace0, \uc774\uc5d0 \ub300\ud55c \uc874\uc911\uc744 \ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4. \ub4dc\ubb3c\uac8c \ud29c\ud130\ubd84\ub4e4\uc758 \uac1c\uc778\uc801\uc778 \uc0c1\ud669\uc774\ub098 \uac74\uac15 \uc774\uc288 \ub4f1\uc73c\ub85c \uac11\uc791\uc2a4\ub7ec\uc6b4 \uc218\uc5c5 \ucde8\uc18c\uac00 \ubc1c\uc0dd\ud558\ub354\ub77c\ub3c4 \ub113\uc740 \ub9c8\uc74c\uc73c\ub85c \uc591\ud574\ud574 \uc8fc\uc2dc\uae30\ub97c \ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4.  \n\u205f  \n\ub610\ud55c, \ucd5c\uc0c1\uc704 \ud29c\ud130\ubd84\ub4e4\ub9cc\uc744 \ubaa8\uc2dc\uae30 \uc704\ud574 \uc6b4\uc601\uc9c4\uc5d0\uc11c \uae4c\ub2e4\ub85c\uc6b4 \uba74\uc811 \uacfc\uc815\uc744 \uac70\uccd0 \uc9c1\uc811 \ucc44\uc6a9\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \uc2e4\ub825 \uc788\ub294 \ud29c\ud130\ubd84\ub4e4 \uc911\uc5d0\uc11c\ub3c4 \ud480 \ud0c0\uc784\uc73c\ub85c \uc77c\ud560 \uc218 \uc788\ub294 \ubd84\ub4e4\uc744 \ucc3e\uae30\uac00 \uc5b4\ub824\uc6cc, \uc624\uc804, \uc624\ud6c4, \uc800\ub141 \uc2dc\uac04\ub300\uc5d0 \ub530\ub77c \uc218\uc5c5 \uac00\ub2a5\ud55c \ud29c\ud130\ubd84\ub4e4\uc774 \ub2ec\ub77c\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc218\uc5c5 \uc2dc\uac04 \ubcc0\uacbd \uc2dc \ud29c\ud130\ubd84\uc774 \uad50\uccb4\ub420 \uc218 \uc788\ub294 \uc810\uacfc \ud574\ub2f9 \ud29c\ud130\ubd84\uc774 \uc7a5\uae30\uac04 \uc218\uc5c5\uc744 \uc81c\uacf5\ud558\uae30 \uc5b4\ub824\uc6b8 \uacbd\uc6b0 \ud29c\ud130\ubd84 \uad50\uccb4\uac00 \uc9c4\ud589\ub420 \uc218 \uc788\uc74c\uc744 \uc774\ud574\ud574 \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.  \n\u205f  \n\uac10\uc0ac\ud569\ub2c8\ub2e4.  \n",null)
